    <p>Se regirán por las siguientes clausulas:</p>
    <p class="texto-justificado"><b>1. EL ARRENDATARIO y/o USUARIO</b> de manera voluntaria y dando certeza de que todo lo que aquí consignado es cierto, por medio del presente documento declara que los recursos entregados provienen de la ocupación profesión y oficio que desarrolla, los cuales no se enmarca dentro de ninguna actividad ilícita de las contempladas en el código penal colombiano o en cualquier norma que lo modifique adicione o complemente.</p>
    <p class="texto-justificado"><b>2. EL ARRENDATARIO y/o USUARIO</b> declara y reconoce que recibe el vehículo especificado en este contrato en el estado de conservación y funcionamiento de acuerdo con el acta de entrega o inventario.</p>
    <p class="texto-justificado"><b>3. CUSTODIA Y CUIDAO; EL ARRENDATARIO y/o USUARIO</b> Deberá hacer entrega del vehículo en las mismas condiciones mecánicas y de conservación en las que fue entregado. Así como el tanque de combustible al mismo nivel como lo recibió. EL ARRENDATARIO deberá sufragar el costo de cualquier gasto adicional en que incurra como chofer, combustible o cualquier otro gasto por el uso del automóvil dado en alquiler se hará responsable del vehículo por su custodia, cuidado, guardia material y jurídica, mientras permanezca en la tenencia del mismo, constituyéndose en depositario oneroso y custodio del vehículo, asumiendo todas las responsabilidades civiles y penales que tal condición implica, hasta tanto proceda a su devolución a ARRENDADOR, para lo cual deberá tomar las medidas necesarias de precaución en la conducción y cuidado del vehículo.</p>
    <p class="texto-justificado"><b>4. EL ARRENDATARIO y/o USUARIO</b> no podrá sacar el vehículo del país sin autorización escrita dada por EL ARRENDADOR.</p>
    <p class="texto-justificado"><b>5. EL ARRENDATARIO y/o USUARIO</b> debe cumplir con las obligaciones establecidas por las normas vigentes de tránsito y toda la normatividad que se relacione con el uso de vehículos, en caso de incumplimiento deberá responder ante el proveedor y las respectivas autoridades por las infracciones de tránsito que se produzcan durante la vigencia del servicio del vehículo y que sean causadas por el ARRENDATARIO y/o conductor.</p>
    <p class="texto-justificado"><b>6. SUSCRIPCIÓN IRREVOCABLE: EL ARRENDATARIO   y/o USUARIO</b> autoriza de manera expresa e irrevocable a la arrendadora el congelamiento del cupo y/o venta no presencial con la tarjeta de crédito que relaciono, conforme a los términos y condiciones del presente contrato PARAGRAFO: Por su seguridad se solicita el código de seguridad de la tarjeta de crédito con el fin de poder realizar la transacción autorizada mediante esta cláusula.</p>
    <p class="texto-justificado"><b>7. DEBERES Y OBLIGACIONES: EL ARRENDATARIO   y/o USUARIO</b> tendrá a su cargo las siguientes obligaciones y deberes derivadas del contrato de arrendamiento y a resarcir a ARRENDADOR los siguientes perjuicios que se llegase a causar durante la tenencia del vehículo: A) Por cualquier daño que se cause con el vehículo a la propiedad, bienes o vehículos de terceras personas; B) Por las lesiones físicas que se causen con el vehículo a terceras personas; C) Responderá contractual y extracontractualmente frente a terceros por los daños que se causen con el vehículo; D) Por los daños causados física y materialmente a personas y/o bienes transportados en el vehículo arrendado; E) Por las violaciones que cometa o le imputen haber cometido contra las normas de tránsito municipales, departamentales y/o nacionales durante el término del arrendamiento; F) Por el 100% del lucro cesante que deje de percibir ARRENDADOR y que venía percibiendo del valor del arrendamiento del vehículo, resultante de la imposibilidad física de poderlo dar en arrendamiento por parte de ARRENDADOR. G) Por el daño emergente resultante de la imposibilidad de ARRENDADOR de no poder volver a utilizar el vehículo en el caso de pérdida total. H) Por el daño moral que se le llegase a causar tanto a ARRENDADOR como a terceras personas por la culpa, descuido y/o negligencia. I) A resarcir el valor de los daños causados al vehículo durante la vigencia del contrato cuando dicho valor supere los cuatro salarios mínimos mensuales legales vigentes (4 SMMLV).</p>
    <p class="texto-justificado"><b>8. RESPONSABILIDADES:</b> En el caso en que el vehículo arrendado sea detenido por las autoridades competentes por causas imputables al ARRENDATARIO, éste será el único responsable por el lucro cesante que se cause hasta la devolución del mismo, valor que resultará de la liquidación que se haga como si EL ARRENDATARIO hubiese utilizado el vehículo durante todo el tiempo que dure su recuperación y cuyo valor será el pactado en el presente contrato de arrendamiento. Así mismo, EL ARRENDATARIO se responsabiliza de todas las consecuencias de carácter judicial, ya sea civil o penal, derivadas de la conducta desplegada por éste y en las que resulte involucrado el vehículo, con ocasión de la violación de las normas vigentes que regulen cada una de estas materias y responderá a título personal por el hecho de cometer algún ilícito o infracción de carácter civil y/o penal en el cual sea involucrado el vehículo. Así mismo serán a cargo del ARRENDATARIO, los gastos por concepto de multas, servicio de grúa, etc., al igual que el costo de las gestiones necesarias para lograr la devolución del vehículo.</p>
    <p class="texto-justificado"><b>9. DEDUCIBLES:</b> EL ARRENDATARIO toma a su cargo el gasto adicional por seguro contra daños causados al vehículo objeto del arrendamiento, cualquiera que fuese la índole del hecho: vuelco, despeñamiento, incendio, hurto, inundación, terremoto, choque simple, etc., con un deducible del 10% por robo o por accidente donde existan daños parciales o pérdida total. El vehículo únicamente ingresará a los talleres asignados por la aseguradora y accederá a la póliza del seguro, previo peritazgo o cotización, cuando los gastos de las reparaciones superen el valor de 4 SMMLV; de lo contrario es EL ARRENDATARIO quien debe asumir dichos costos. Si el vehículo es de servicio público, el deducible será del 20%. El pago no exime al ARRENDATARIO de asumir los gastos de recuperación o reparación del vehículo, en el caso de que los hechos sean imputables a su culpa y/o negligencia en la conducción, cuidado y custodia del vehículo.</p>
    <p class="texto-justificado"><b>10. ACEPTACIÓN DE RESPONSABILIDAD ANTE INFRACCIONES DE TRÁNSITO POR MEDIOS ELECTRÓNICOS O FOTOMULTAS Y/O DAÑOS GENERADOS AL VEHÍCULO O CAMIONETA ANEXO AL CONTRATO AB-2031:</b> Por medio de la presente, yo, <b>{{$contratos->nombres}} {{$contratos->apellidos}}</b>, identificado con <b>{{$contratos->tipo_documento}} {{$contratos->numero_documento}} </b>, declaro que me hago responsable de todo tipo de infración de transito y/o daño generado por mí durante la tenencia del vehículo o camioneta que he recibido en alquiler por la empresa <b>RENT A CAR PASTO</b>. <br> Por lo tanto,autorizo a <b>RENT A CAR PASTO</b>, representada por alguno de sus funcionarios o persona a quien se delegue, a realizar los reportes respectivos a las autoridades competentes. De igual manera, autorizo para que se solicite información sobre infracciones de tránsito que posiblemente sean cometidas durante la vigencia del alquiler del vehículo.<br>Declaro igualmente, que asumo todos los gastos que se pudieran ocasionar con referencia a infracciones de transito y/o daños generados al vehiculo y/o camioneta.</p>
    <p class="texto-justificado"><b>11. GARANTÍA:</b> En caso de algún siniestro como hurto o accidente y como consecuencia de esto sea declarado por parte de la aseguradora a la cual se encuentra afiliado el vehículo como pérdida total, EL ARRENDATARIO pagará a ARRENDADOR el 10% del valor comercial del vehículo ó el 20% si el vehículo es de servicio público, para lo cual se tomará como base el precio establecido en la factura de venta del vehículo objeto de este contrato y adicionalmente el 100% del lucro cesante (stand-by) del vehículo, para lo cual EL ARRENDATARIO firma el título valor LETRA DE CAMBIO Nro.	con carta de instrucciones, que es dejado en garantía por los daños que el vehículo pudiere llegar a sufrir o cualquier otra índole como ya quedó estipulado en las cláusulas anteriores, durante el término del arrendamiento. Si por algún motivo EL ARRENDATARIO se llegase a negar al pago de los daños causados al vehículo o de alguno de los valores derivados del incumplimiento de cualquiera de las cláusulas de este contrato durante el arrendamiento, este título valor se llenará por las sumas de dinero resultante de las liquidaciones que se efectúen de acuerdo al daño causado al vehículo por parte del ARRENDATARIO o derivados por la pérdida total del mismo, el lucro cesante (stand-by), el daño emergente o cualquier otro concepto; sin dar derecho a reclamación alguna por parte del ARRENDATARIO.
    <p class="texto-justificado" style="background-color:#fffb00";>Parágrafo: Así mismo, el depósito en garantía que EL ARRENDATARIO ha entregado a ARRENDADOR, bien sea en efectivo o en voucher de tarjeta de crédito, será devuelto al ARRENDATARIO en un término de 6 días hábiles posteriores a la entrega o devolución del vehículo, una vez se verifique que no se hayan aplicado multas o comparendos electrónicos durante el término de la renta, u otros conceptos que se adeudaren.</p></p>
    <p class="texto-justificado"><b>12. CUBRIMIENTO DE DAÑOS:</b> Las reparaciones de los daños y/o averías que por cualquier circunstancia sufra el vehículo se harán únicamente en la forma y en los talleres que indique ARRENDADOR y para calcular el valor de los daños causados al vehículo, las partes se someten a una cotización o dictamen pericial por parte de un concesionario automotriz debidamente autorizado por los ensambladores de automóviles en Colombia, y el vehículo sólo ingresara a los talleres asignados por la aseguradora y accederá a la póliza del seguro si los gastos de las reparaciones superan el valor de cuatro salarios mínimos mensuales legales vigentes (4 SMMLV); de lo contrario ARRENDADOR determinará el taller adonde debe ingresar el vehículo para que le realicen las reparaciones y será EL ARRENDATARIO quien asumirá dichos costos. El tiempo que dure el vehículo en el taller mientras se realicen las reparaciones respectivas, bien sea días o semanas, será cancelado por EL ARRENDATARIO como lucro cesante hasta el día que el vehículo sea recibido por ARRENDADOR; dicho valor será liquidado de acuerdo a lo establecido Si el vehículo es de servicio público se incrementará dicho valor en un 20%. El pago no exime al ARRENDATARIO de asumir los gastos de recuperación del vehículo en el caso de que los hechos sean imputables a su culpa y/o por negligencia en la conducción, cuidado y custodia del vehículo.</p>
    <p class="texto-justificado"><b>13. SANEAMIENTO:</b> Si por alguna circunstancia surgiera alguna reclamación por parte de alguna autoridad, o de un tercero posteriormente de que el vehículo hubiese sido entregado y recibido por ARRENDADOR y ya se hubiese liquidado el contrato, EL ARRENDATARIO se obligará a responder y saldrá al saneamiento ante dicha autoridad, ante terceros o ante ARRENDADOR según sea el caso, por cualquier infracción cometida durante el tiempo que lo tuvo bajo su responsabilidad.</p>
    <p class="texto-justificado"><b>14. MANEJO DE DATOS PERSONALES E INCUMPLIMIENTO:</b> El abajo firmante en su propio nombre o en nombre de la entidad que representa declara que la información suministrada es verídica y da consentimiento expreso al ARRENDADOR o a quien en un futuro haga sus veces como titular del servicio solicitado para, Realizar el tratamiento de sus datos personales y reportar el incumplimiento de este contrato reflejándose negativamente ante las centrales de riesgo según el artículo 12 de la ley 1266 del 2008.</p>
    
